  false,\n\t\"url\": null,\n\t\"notes\": \"These data represent a cost-earnings study
  of the Main Hawaiian Islands bottomfish fishery for the 2010 operating year. Data
  collected include fisher classification, vessel characteristics, levels of investment,
  trip-level expenditures, fishing behavior, market participation, social aspects
  of the fishery, and demographics. Additionally, attitudes and perceptions towards
  fisheries management agencies and current and future management tools are described.\",\n\t\"license_title\":
